import { StyleSheet } from "react-native";
import Start from "./StartStack";
import { WeekContext, WeekProvider } from "./src/context/weekContext";

export default function App() {

  return (
    <WeekProvider>
      <Start/>
      </WeekProvider>
  )

}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "#fff",
    alignItems: "center",
    justifyContent: "center",
  },
});
